import React, { useEffect } from "react";
import { Navigate,useParams,useNavigate,useLocation,useMatch} from "react-router-dom";
import AuthHandler from "./AuthHandler";
import MainComponent from "../Components/MainComponent";

export var PrivateRouteNew  = ({activepage,page,props})  => {
  const navigate = useNavigate();
  const location = useLocation();
  const match = useMatch();

  useEffect(() => {
    console.log(props);
  }, [props]);
  
  return AuthHandler.loggedIn() ? (
      <MainComponent page ={page} activepage={activepage}  />) :
      (<Navigate to="/" />)
}
